import React from 'react';
import './App.css';
import Nav from './components/nav';
import HowItWorks from './components/howitworks';
import Signup from './components/signup';

import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <Nav />
      <HowItWorks />
      <Signup />
    </div>

  );
}

export default App;
